import React from "react";

const ExplorePage = ({ houseData }) => {
  return (
    <div className="searchResults">
      {houseData.map((house, index) => (
        <Card location={house.location.area} image={house.image_path[0]} />
      ))}
    </div>
  );
};

export default ExplorePage;
